  return (
    <div className=" flex  justify-evenly items-center">
      <header className="">


        <Link to='/q1' >Question 1</Link >
        <Link to='/q2'> Question 2</Link >
      </header>

      <Router>
        <Route path='/q1' component={q1} />
        <Route path='/q2' component={q2} />
      </Router>
    </div>
  );
}

export default App;
